import "./style.css";

export const Boton = (e) => {
  return <button className="Square">{e.valor}</button>;
};

export const BotonRow = (x) => {
  return (
    <>
      <Boton valor={x.value}/>
      <Boton valor={x.value}/>
      <Boton valor={x.value}/>
    </>
  );
};

export const Square = () => {
  return (
    <>
      <div className="boardRow">
        <BotonRow value='2'/>
      </div>

      <div className="boardRow">
        <BotonRow/>
      </div>

      <div className="boardRow">
        <BotonRow/>
      </div>
    </>
  );
};
